#include <iostream> 
#include <cmath> 
#include <cstdio> 
#include <cstdlib> 
#include <cstring> 
#include <string> 
#include <vector> 
#include <algorithm> 
using namespace std; 
 
class GogoXCake{ 
public: 
    int r1, c1, r2, c2; 
    bool visit[55][55]; 
    bool check(const vector <string> &cake, const vector <string> &cutter, int x, int y){ 
        for(int i = 0; i < r2; i++) 
            for(int j = 0; j < c2; j++){ 
                if(cutter[i][j] == '.'){ 
                    if(!visit[x+i][y+j] && cake[x+i][y+j]=='.')  continue; 
                    else  return  false; 
                } 
            } 
        return  true; 
    } 
    void cover(const vector <string> &cutter, int x, int y){ 
        for(int i = 0; i < r2; i++) 
            for(int j = 0; j < c2; j++){ 
                if(cutter[i][j] == '.') 
                    visit[x+i][y+j] = true; 
            } 
    } 
    string solve(vector <string> cake, vector <string> cutter){ 
        r1 = cake.size(); 
        c1 = cake[0].length(); 
        r2 = cutter.size(); 
        c2 = cutter[0].length(); 
        bool flag = true; 
        memset(visit, false, sizeof(visit)); 
        while(flag){ 
            flag = false; 
            for(int i = 0; i+r2 <= r1; i++){ 
                if(flag)  break; 
                for(int j = 0; j+c2 <= c1; j++){ 
                    if(check(cake, cutter, i, j)){ 
                        flag = true; 
                        cover(cutter, i, j); 
                        break; 
                    } 
                } 
            } 
        } 
        for(int i = 0; i < r1; i++) 
            for(int j = 0; j < c1; j++){ 
                if(cake[i][j]=='X' && visit[i][j]==true) 
                    return  "NO"; 
                if(cake[i][j]=='.' && visit[i][j]==false) 
                    return  "NO"; 
            } 
        return  "YES"; 
    } 
};

